import React from 'react';
import './ImageLinkForm.css'

const ImageLinkForm = ({onInputChange,onDetectButton}) =>{
 return(
 	<div>
    	<p className='f3'>
    		{'This Magic brain will detect faces in your pictures.Give a try!!'}
    	</p>
    	<div className='center'>
    		<div className='form center pa4 shadow-5 br3'>
    			<input className='f4 pa2 w-190 center' type='text' onChange={onInputChange}/>
    			<button 
    				className='w-30 grow f4 link ph3 pv2 dib white bg-light-pink'
    				onClick={onDetectButton}
    				>Detect</button>
 			</div>
 		</div>
 	</div>
  );
}


export default ImageLinkForm;
